import React, { Component } from 'react';
import { Text, View, StyleSheet,Image,TouchableOpacity } from 'react-native';
import "./hunter-james-fAOqScBvMSc-unsplash.jpg"
import PageHeader from "../PageAttributes/PageHeader";
import SearchBackground from "./hunter-james-fAOqScBvMSc-unsplash.jpg"

export default class HomePage extends Component {

    render() {
        return (
            <div>
                <PageHeader />
                <View style={styles.container}>
                    <Image
                        source={{ uri:{SearchBackground} }}
                        style={ styles.imageWrapper }>
                        <TouchableOpacity
                            style={ styles.button }
                            onPress={ () => { alert("handler here") }}>
                            <Text style={ styles.text }>Ã—</Text>
                        </TouchableOpacity>
                    </Image>
                </View>
            </div>
        );
    }

}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
        paddingTop: 64,
        backgroundColor: '#ecf0f1',
    },
    imageWrapper:{
        width:200,
        height:300,
        borderRadius:20
    },
    button:{
        width:30,
        height:30,
        backgroundColor:'red',
        alignItems:'center',
        justifyContent:'center',
        overflow:'hidden',
        borderRadius:20,
        position:'absolute',
        left:20,
        top:20
    },
    text:{
        fontSize:40,
        color:'white',
        lineHeight:42
    }
});
